# OEIS sequence: A026465

def A026465(n):
    if n==1: return 1
    def iterfun(f,n=0):
        m, k = n, f(n)
        while m != k: m, k = k, f(k)
        return m
    def f(x):
        c, s = x, bin(x)[2:]
        l = len(s)
        for i in range(l&1^1,l,2):
            c -= int(s[i])+int('0'+s[:i],2)
        return c
    return iterfun(lambda x:f(x)+n,n)-iterfun(lambda x:f(x)+n-1,n-1) # _Chai Wah Wu_, Jan 29 2025

